import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";

const Home = () => {
  return (
    <div className="Home">
      <img src={Cover} alt="" />
      <div className="fil"></div>
      <div className="sen1">
        <h1>Let's Reduce and Reuse plastics</h1>
      </div>
      <div className="button">
        <img src={Cover} alt="" />
      </div>
      <div className="sen2">
        <h1>Let's Reduce and Reuse plastics</h1>
      </div>
    </div>
  );
};

export default Home;
